import React from "react";
import {useForm} from 'react-hook-form'
import classes from './RegisterForm.module.css';

export default function RegisterForm( props ) {

  let {
    register,
    handleSubmit
  } = useForm()

  let onSubmit =(data) => {
        console.log(data)
    }

  return (
    <form onSubmit={handleSubmit()} className={classes.contactsFormContainer}>
      <input {...register('login')} placeholder="Login" type="text" className={classes.contactsInput} />

      <input {...register('pass')} placeholder="Password" type="password" className={classes.contactsInput} />

      <button className={classes.submitButton}>Enter</button>
    </form>
  );
}
